  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mark Twain
  National Wildlife Refuge outlines Refuge accomplishments during the 1968 calendar
  year. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, and raptors- is also covered. The Refuge development and maintenance
  section discusses physical developments. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes hunting and safety. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
